import React from 'react'

import s from './Cooperate.module.css'
import IconButton from "../../components/ButtonWithIcon/Button";
import fb from "../../assets/rounded-fb.svg";
import twitter from "../../assets/twitter.svg";
import Button from "../../components/Button/Button";
import omon from '../../assets/omon.png'

const Cooperate = () => {
    return (
      <div className={s.container}>
        <div className={s.inner}>

          <div className={s.articles}>
            <a className={s.article} href="/">
              <img src={omon} alt="omon" />
              <p className={s.name}>
                Разгон мирных акций солидарности и захват подростков
                сотрудниками ОМОНА
              </p>
            </a>
          </div>
        </div>
      </div>
    );
}

export default Cooperate
